import React from "react";
import Card from "@material-tailwind/react/Card";
import CardRow from "@material-tailwind/react/CardRow";
import CardHeader from "@material-tailwind/react/CardHeader";
import CardStatus from "@material-tailwind/react/CardStatus";
import CardStatusFooter from "@material-tailwind/react/CardStatusFooter";
import Icon from "@material-tailwind/react/Icon";

const ArtistCards = () => {
    return (
        <div>
            <Card>
                <CardRow>
                    <CardHeader color="lightBlue" size="sm" iconOnly src="https://upload.wikimedia.org/wikipedia/commons/2/24/Circle-icons-image.svg">
                    <div>
                        <img src="https://upload.wikimedia.org/wikipedia/commons/2/24/Circle-icons-image.svg" />
                        <strong>Andrew Alfred</strong>
                    </div>
                </CardHeader>

                <CardStatus title="Users" amount="350,000" />
            </CardRow>

            <CardStatusFooter color="green" amount="97%" date="Since one week">
                <Icon color="green" name="arrow_upward" />
            </CardStatusFooter>
        </Card>
        </div >
    )

}

export default ArtistCards
